import React, { Component } from 'react';
import './App.css';
import Icon from './images/gooseberry.png'

const illnesses = [{text:"Common cold", rating:"3", reviews:"10", img:<img class="icon" src={Icon} alt="gooseberry"/>},
  {text:"Nausea", rating:"3", reviews:"10"},
  {text:"Mental Health", rating:"3", reviews:"10"},
  {text:"Migraines", rating:"3", reviews:"10"},
  {text:"Digestive Disorders", rating:"3", reviews:"10"},
  {text:"Eye health", rating:"3", reviews:"10"},
  {text:"Food Poisoning", rating:"3", reviews:"10"},
  {text:"Kidney Stones", rating:"3", reviews:"10"},
  {text:"Dermotology", rating:"3", reviews:"10"},
  {text:"Menstrual health", rating:"3", reviews:"10"},
  {text:"Osteoporasis", rating:"3", reviews:"10"},
  {text:"Sleep Disorders", rating:"3", reviews:"10"}];
const list = illnesses.map((illness) =>
  <tr>
    <td><img class="icon" src={Icon} alt="gooseberry"/></td>
    <td><h2 class="title"><strong>{illness.text}</strong></h2></td>
    <td><p class="detail"><strong>Rating:</strong> {illness.rating}/5</p></td>
    <td><p class="detail"><strong>Reviews:</strong> {illness.reviews}</p></td>
  </tr>
);

class List extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>List of Illnesses</h1>
          <table className="table hover">
            <thead></thead>
            <tbody>{list}</tbody>
          </table>
        </header>
      </div>
    );
  }
}

export default List;
